// Creación de mapa
var map = L.map("mapid");
var map2 = L.map("map2id");

// Coord centrales de despliege y nivel de zoom
var center = L.latLng([12.5, -85.0]);
var zoomLevel = 6;

// Despliege de vista con los paramentros establecidos
map.setView(center, zoomLevel);
map2.setView(center, zoomLevel);

// Añadir escala gráfica
L.control.scale({imperial:false}).addTo(map);
L.control.scale({imperial:false}).addTo(map2);

// Añadir mapas base a variables
osmLayer = L.tileLayer.provider("OpenStreetMap.Mapnik").addTo(map);
terrain = L.tileLayer.provider("Stamen.TerrainBackground").addTo(map2);

// Añadir capa ráster 
var precipitationLayer = L.imageOverlay("mean_pre_ac.png", 
	[[18.5000000000000000, -92.2249999999999943], 
	[7.1999999999999993, -77.1749999999999972]], 
	{opacity:0.5}
).addTo(map2);

// Función de opacidad de capa ráster
function updateOpacity() {
	document.getElementById("span-opacity").innerHTML = document.getElementById("sld-opacity").value;
	precipitationLayer.setOpacity(document.getElementById("sld-opacity").value);
}

// Paleta de colores capa GEOJSON
function getColor(d) {
    return d > 1600 ? '#ff7b10' :
           d > 800  ? '#ff9c08' :
           d > 400  ? '#ffce08' :
           d > 200  ? '#ffe710' :
           d > 100   ? '#dede63' :
           d > 50   ? '#b5d663' :
           d > 25   ? '#74c353' :
                      '#4aad5a';
}

// LLamamdo y estilo de capas GEOJSON

$.getJSON("cultivos.geojson", function(geodata) {
	var layer_geojson_cotton = L.geoJson(geodata, {
		style: function(feature) {
			return {
				fillColor: getColor(feature.properties.algodonmea),
				weight: 1,
				opacity: 0.75,
				color: '#7f8c8d',
				fillOpacity: 0.75
			}
		},
		onEachFeature: function(feature, layer) {
			var popupText = "Municipio: " + feature.properties.NAME_2 + "<br>" 
			+ "Hectáreas de algodon: " + feature.properties.algodonmea;
			layer.bindPopup(popupText);
		}			
	}).addTo(map);
	control_layers.addOverlay(layer_geojson_cotton, 'Producción de algodon');
	layer_geojson_cotton.remove();
});

