var paises_ac = L.layerGroup().addTo(map2);

function colorPolis(d) { 
	return d == "Panama" ? '#302f2f' : 
		d == "Costa Rica" ? '#b53038' : 
		d == "Nicaragua" ? '#293d93' : 
		d == "Honduras" ? '#f1c915' :
		d == "El Salvador" ? '#00ff00' :
		d == "Guatemala" ? '#e07c2b' :
		'#000000'; 
	};
	
function myFunction() {
	$.getJSON("ac_1.geojson", function(geodata){
		var stripes = new L.StripePattern();
		stripes.addTo(map2);
		var layer_geojson_ac = L.geoJson(geodata, {
			style: function(feature) {
			return {
				fillPattern: stripes,
				color: colorPolis(feature.properties.NAME_0),
				weight: 2,
				}
			},
			onEachFeature: function(feature, layer) {
				var popupText = "País: " + feature.properties.NAME_0;
				layer.bindPopup(popupText);
			}
		});
	paises_ac.addLayer(layer_geojson_ac);
	/*control_layers2.addOverlay(layer_geojson_ac, 'Países');*/
	/*layer_geojson_ac.remove();*/
	});
};

function estiloSelect() {
	var miSelect = document.getElementById("estilo").value;
	
	$.getJSON("ac_1.geojson", function(geodata){
		var stripes = new L.StripePattern();
		stripes.addTo(map2);
		var layer_geojson_ac = L.geoJson(geodata, {
			filter: function(feature, layer) {								
				if(miSelect != "TODOS")		
				return (feature.properties.NAME_0 == miSelect );
				else
				return true;
			},	
			style: function(feature) {
			return {
				fillPattern: stripes,
				color: colorPolis(feature.properties.NAME_0),
				weight: 2,
				}
			},
			onEachFeature: function(feature, layer) {
				var popupText = "País: " + feature.properties.NAME_0;
				layer.bindPopup(popupText);
			}
		});
 		paises_ac.clearLayers();
		paises_ac.addLayer(layer_geojson_ac);
	});		
};

